import Movie from "../components/Movie";
import { useState, useEffect } from "react";

function Home() {
  const [movie, setMovie] = useState([]);
  const getMovie = async () => {

    await await fetch(
      `https://yts.mx/api/v2/list_movies.json?minimum_rating=9&sort_by=year`
    );
  };
  return <div></div>;
}

export default Home;
